import React from "react";
import { Card, CardHeader, CardBody, CardFooter } from 'react-simple-card';

function Uploadimg() {
  return (
    <div className="uploadimg">
       <div class="card" >
              <div class="card-body">
                <p class="card-text">Image<br/>Processed Daily</p>
              </div>
        </div>
    </div>
  );
}

export default Uploadimg;
